import React from 'react';

function Form()
{

    function Change(event){
        console.log(event.target.value)
    }

    return(
        <>
            <form>
                <div>
                    <input type="text" placeholder="Enter Your Name" value="" onChange={Change}/>

                </div>
            </form>
        </>
    )
}

export default Form;
